import './App.css';
import {Route, Routes} from "react-router-dom";

function App() {
  return (
    <div>
      <Route path="/" element={<div>1</div>}/>
      <Route path="/affiliate" element={<div>1</div>}/>
      <Route path="/registration" element={<div>1</div>}/>
      <Route path="/affiliate/registration" element={<div>1</div>}/>
    </div>
  );
}

export default App;
